import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Brain, Image, Upload, AlertTriangle, CheckCircle, Clock, TrendingUp } from 'lucide-react';

const AIAnalysis = ({ analysis, loading }) => {
  const [imageUrl, setImageUrl] = useState('');
  const [showImageInput, setShowImageInput] = useState(false);

  if (!analysis) {
    return (
      <div className="card">
        <div className="text-center py-8">
          <Brain className="h-12 w-12 text-purple-400 mx-auto mb-4" />
          <h3 className="text-lg font-semibold text-white mb-2">AI Analysis</h3>
          <p className="text-gray-400">Run a performance test to get AI-powered insights</p>
        </div>
      </div>
    );
  }

  const { success, analysis: analysisData, agent_response, ai_provider, image_analyzed } = analysis;

  if (!success) {
    return (
      <div className="card">
        <div className="flex items-center space-x-3 text-red-400">
          <AlertTriangle className="h-6 w-6" />
          <div>
            <h3 className="font-semibold">Analysis Failed</h3>
            <p className="text-sm">{analysis.error || 'Unknown error occurred'}</p>
          </div>
        </div>
      </div>
    );
  }

  const getSeverityColor = (severity) => {
    switch (severity?.toUpperCase()) {
      case 'CRITICAL': return 'text-red-400';
      case 'HIGH': return 'text-orange-400';
      case 'MEDIUM': return 'text-yellow-400';
      case 'LOW': return 'text-green-400';
      default: return 'text-gray-400';
    }
  };

  const getAssessmentColor = (assessment) => {
    switch (assessment?.toLowerCase()) {
      case 'excellent': return 'text-green-400';
      case 'good': return 'text-blue-400';
      case 'fair': return 'text-yellow-400';
      case 'poor': return 'text-red-400';
      default: return 'text-gray-400';
    }
  };

  return (
    <div className="space-y-6">
      {/* AI Provider Info */}
      <div className="card">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-3">
            <Brain className="h-6 w-6 text-purple-400" />
            <div>
              <h3 className="font-semibold text-white">AI Analysis</h3>
              <p className="text-sm text-gray-400">
                Powered by {ai_provider === 'openrouter' ? 'OpenRouter (Gemini 2.0 Flash)' : 
                           ai_provider === 'gemini' ? 'Google Gemini' : 'Fallback Analysis'}
              </p>
            </div>
          </div>
          {image_analyzed && (
            <div className="flex items-center space-x-2 text-blue-400">
              <Image className="h-4 w-4" />
              <span className="text-sm">Image Analyzed</span>
            </div>
          )}
        </div>
      </div>

      {/* Assessment Summary */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="card"
        >
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-400">Assessment</p>
              <p className={`text-2xl font-bold ${getAssessmentColor(analysisData.assessment)}`}>
                {analysisData.assessment}
              </p>
            </div>
            <CheckCircle className="h-8 w-8 text-green-400" />
          </div>
        </motion.div>

        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.1 }}
          className="card"
        >
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-400">Severity</p>
              <p className={`text-2xl font-bold ${getSeverityColor(agent_response?.severity)}`}>
                {agent_response?.severity || 'MEDIUM'}
              </p>
            </div>
            <AlertTriangle className="h-8 w-8 text-orange-400" />
          </div>
        </motion.div>

        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.2 }}
          className="card"
        >
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm font-medium text-gray-400">Confidence</p>
              <p className="text-2xl font-bold text-purple-400">
                {Math.round((analysisData.confidence_score || 0) * 100)}%
              </p>
            </div>
            <TrendingUp className="h-8 w-8 text-purple-400" />
          </div>
        </motion.div>
      </div>

      {/* AI Insights */}
      <motion.div 
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.3 }}
        className="card"
      >
        <h3 className="text-lg font-semibold text-white mb-4">AI Insights</h3>
        <div className="space-y-3">
          {analysisData.insights?.map((insight, index) => (
            <div key={index} className="flex items-start space-x-3">
              <div className="w-2 h-2 bg-purple-400 rounded-full mt-2 flex-shrink-0"></div>
              <p className="text-gray-300">{insight}</p>
            </div>
          ))}
        </div>
      </motion.div>

      {/* Problem & Root Cause */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.4 }}
          className="card"
        >
          <h3 className="text-lg font-semibold text-white mb-4">Problem Identified</h3>
          <p className="text-gray-300">{agent_response?.problem || 'No significant problems detected'}</p>
        </motion.div>

        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5 }}
          className="card"
        >
          <h3 className="text-lg font-semibold text-white mb-4">Root Cause</h3>
          <p className="text-gray-300">{agent_response?.cause || 'System performing within expected parameters'}</p>
        </motion.div>
      </div>

      {/* Potential Bottlenecks */}
      {analysisData.bottlenecks && analysisData.bottlenecks.length > 0 && (
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.6 }}
          className="card"
        >
          <h3 className="text-lg font-semibold text-white mb-4">Potential Bottlenecks</h3>
          <div className="space-y-2">
            {analysisData.bottlenecks.map((bottleneck, index) => (
              <div key={index} className="flex items-start space-x-3">
                <div className="w-2 h-2 bg-red-400 rounded-full mt-2 flex-shrink-0"></div>
                <p className="text-gray-300">{bottleneck}</p>
              </div>
            ))}
          </div>
        </motion.div>
      )}

      {/* AI Recommendations */}
      <motion.div 
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.7 }}
        className="card"
      >
        <h3 className="text-lg font-semibold text-white mb-4">AI Recommendations</h3>
        <div className="space-y-3">
          {analysisData.recommendations?.map((recommendation, index) => (
            <div key={index} className="flex items-start space-x-3">
              <div className="w-2 h-2 bg-blue-400 rounded-full mt-2 flex-shrink-0"></div>
              <p className="text-gray-300">{recommendation}</p>
            </div>
          ))}
        </div>
      </motion.div>

      {/* Production Readiness */}
      <motion.div 
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.8 }}
        className="card"
      >
        <div className="flex items-center justify-between">
          <div>
            <h3 className="text-lg font-semibold text-white">Production Readiness</h3>
            <p className="text-gray-400">
              {analysisData.production_ready 
                ? 'System is ready for production deployment' 
                : 'System needs optimization before production deployment'}
            </p>
          </div>
          <div className={`flex items-center space-x-2 ${analysisData.production_ready ? 'text-green-400' : 'text-orange-400'}`}>
            {analysisData.production_ready ? (
              <CheckCircle className="h-6 w-6" />
            ) : (
              <Clock className="h-6 w-6" />
            )}
            <span className="font-semibold">
              {analysisData.production_ready ? 'Ready' : 'Needs Work'}
            </span>
          </div>
        </div>
      </motion.div>

      {/* Image Analysis Section */}
      {ai_provider === 'openrouter' && (
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.9 }}
          className="card"
        >
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-lg font-semibold text-white">Image Analysis</h3>
            <button
              onClick={() => setShowImageInput(!showImageInput)}
              className="btn-secondary text-sm"
            >
              {showImageInput ? 'Hide' : 'Add Image'}
            </button>
          </div>
          
          {showImageInput && (
            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-300 mb-2">
                  Image URL
                </label>
                <input
                  type="url"
                  value={imageUrl}
                  onChange={(e) => setImageUrl(e.target.value)}
                  placeholder="https://example.com/image.jpg"
                  className="input-field w-full"
                />
              </div>
              <button
                onClick={() => {
                  // This would trigger a new analysis with the image
                  console.log('Analyze with image:', imageUrl);
                }}
                className="btn-primary"
                disabled={!imageUrl}
              >
                <Image className="h-4 w-4 mr-2" />
                Analyze with Image
              </button>
            </div>
          )}
          
          <p className="text-sm text-gray-400 mt-2">
            Add screenshots or charts to get enhanced AI analysis with visual context.
          </p>
        </motion.div>
      )}

      {/* Auto-Retry Information */}
      {analysis.auto_retry && (
        <motion.div 
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 1.0 }}
          className="card"
        >
          <div className="flex items-center space-x-3">
            <div className={`w-2 h-2 rounded-full ${analysis.auto_retry.triggered ? 'bg-green-400' : 'bg-gray-400'}`}></div>
            <div>
              <h3 className="font-semibold text-white">Auto-Retry</h3>
              <p className="text-sm text-gray-400">
                {analysis.auto_retry.triggered 
                  ? `New test initiated: ${analysis.auto_retry.new_test_id}`
                  : analysis.auto_retry.reason || 'No retry recommended'}
              </p>
            </div>
          </div>
        </motion.div>
      )}
    </div>
  );
};

export default AIAnalysis;
